export const OpnionData = [
  {
    name: 'Beatrice',
    age: '25',
    describe: "It's smooth, cleans the skin really well, I just miss a little smell.",
  },
  {
    name: 'Denise',
    age: '37',
    describe: "serum with hyaluronic acid and vitamin c at an affordable price",
  },
  {
    name: 'Beatrice',
    age: '25',
    describe: "I love this product, it doesn't burn and doesn't leave that 'refreshing' and dry feeling after drying the face. Leaves skin soft and clean well.",
